import React, { useState } from 'react';

const App = () => {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    gender: '',
    fitnessLevel: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const generateRoutine = () => {
    // Aquí deberías implementar la lógica para generar la rutina diaria en función de los datos del usuario
    // Este es solo un ejemplo simple
    return (
      <div>
        <h2>Rutina Diaria</h2>
        <p>¡Hola {formData.name}!</p>
        <p>Tu rutina para hoy incluye:</p>
        <ul>
          <li>Ejercicio 1: 3 series de 10 repeticiones</li>
          <li>Ejercicio 2: 4 series de 12 repeticiones</li>
          <li>Ejercicio 3: 3 series de 8 repeticiones</li>
        </ul>
      </div>
    );
  };

  return (
    <div className="App">
      <h1>Generador de Rutinas Diarias</h1>
      <form>
        <label>
          Nombre:
          <input type="text" name="name" value={formData.name} onChange={handleChange} />
        </label>
        <br />
        <label>
          Edad:
          <input type="number" name="age" value={formData.age} onChange={handleChange} />
        </label>
        <br />
        <label>
          Género:
          <select name="gender" value={formData.gender} onChange={handleChange}>
            <option value="male">Masculino</option>
            <option value="female">Femenino</option>
          </select>
        </label>
        <br />
        <label>
          Nivel de Fitness:
          <select name="fitnessLevel" value={formData.fitnessLevel} onChange={handleChange}>
            <option value="beginner">Principiante</option>
            <option value="intermediate">Intermedio</option>
            <option value="advanced">Avanzado</option>
          </select>
        </label>
      </form>
      <button onClick={generateRoutine}>Generar Rutina</button>
    </div>
  );
};

export default App;
